//start
let strt = document.createElement("div");
let body = document.querySelector("body");
let strtcont = document.createElement("div");

strt.appendChild(strtcont);
strt.classList.add("strt");
body.appendChild(strt);
strtcont.classList.add("stcont");
let warning = document.createElement("div");
warning.textContent = "Enter your name";
strtcont.appendChild(warning);

let inp = document.createElement("input");
inp.type = "text";
inp.classList.add("inp");

strtcont.appendChild(inp);

let btn = document.createElement("button");
strtcont.appendChild(btn);
btn.classList.add("btn");
btn.textContent = "Start";
strtcont.appendChild(btn);

btn.addEventListener("click", removestrt);
btn.addEventListener("click",setCounting);

function removestrt() {
  if (inp.value.length != 0) {
    let usn = document.createElement("span");
    usn.textContent = inp.value;
    stat.appendChild(usn);
    usn.classList.add("timer");

    strt.remove();
  } else {
    let count = 0;
    setInterval(warn, 200);
    function warn() {
      if (count > 5) return;
      warning.classList.toggle("warn");
      count++;
    }
  }
}
