function shuffle() {
  for (let i = svg.length - 1; i >= 0; i--) {
    let j = Math.floor(Math.random() * (i + 1));
    let temp = svg[i];
    svg[i] = svg[j];
    svg[j] = temp;
  }
}
shuffle();

let i = 0; //counter for svg arr
let cont = document.getElementsByClassName("container1");
function createCard() {
  let card = document.createElement("div");
  let front = document.createElement("div");
  let back = document.createElement("div");
  front.classList.add("front");
  back.classList.add("back");
  card.classList.add("card");
  front.textContent = "!";
  back.innerHTML = svg[i];
  i++;
  card.appendChild(front);
  card.appendChild(back);
  cont[0].appendChild(card);
  //men 8eer 2l index hytal3 error 34an
  //mmkn ykoon fee kza class w bee kda maynf34 t3mlhom kolhom
  //append child
}
for (let k = 1; k <= 24; k++) createCard();

let stat = document.querySelector(".stats");
//usn done stat declared later (normal cuz of hoisting)

let countErr = document.createElement("span");
countErr.textContent="incorrect : 0";
countErr.classList.add("timer");
stat.appendChild(countErr);

let timer = document.createElement("span");
timer.classList.add("timer");
timer.textContent="0:00";
stat.appendChild(timer);


function setCounting()
{
let contID=setInterval(countdown, 1000);//returns id to use in clear interval
//1000 millisec= 1 sec
const startMinuits = 3;
let time = startMinuits * 60;
//convert to sec
function countdown() {
  
  let minuits = Math.floor(time / 60);
  let seconds = time % 60;
  seconds = seconds < 10 ? "0" + seconds : seconds;
   //2zay 7fez 2l zero
   //ternary operator
  timer.textContent = `${minuits}:${seconds}`;
  time--;
  if(time<20)
   {
    timer.style.color="red";
    timer.style.fontWeight="bold";
   } 
       console.log(time);
if(time==-1) //timer div exceeds the time by 1 
   {
    clearInterval(contID);
    setTimeout(()=>{
      let end=document.createElement("div");
      end.classList.add("endDiv");
     body.appendChild(end);
     end.innerHTML='<div>Hard Luck</div><div>You Lose!!</div>';
    },1300); 
     setTimeout(() => {
           document.location.reload();
             //reloads page;
     }, 3500); 
    }
   } 
}

let correct=0;
let errcounter = 0;
cont[0].addEventListener("click", checkSame);
let firstcard;
let count = 0;


function checkSame(event) {
  if (event.target.className == "front") {
    let current = event.target.parentElement;
    count++;
    current.classList.add("cardClicked");
    if (count % 2 != 0) {
      firstcard = current;
    } else if (count % 2 == 0 &&!current.isEqualNode(firstcard)) {
      setTimeout(() => {
              errcounter++;
              countErr.textContent="incorrect : "+errcounter;
        firstcard.classList.remove("cardClicked");
        current.classList.remove("cardClicked");
      }, 1100);
      /*
       settimeout does action only once
       setinterval does action continously
       */
    }
    else
    correct+=2;
  }
  if(correct==24)
  {  setTimeout(()=>{
    let end=document.createElement("div");
    end.classList.add("endDiv");
   body.appendChild(end);
   end.innerHTML='<div>Congratulations</div><div>You Win!!</div>';
  },1300); 
   setTimeout(() => {
         document.location.reload();
           //reloads page;
   }, 3500);
  }
}
